CREATE DEFINER=`root`@`localhost` PROCEDURE `employeesGetAll`()
BEGIN
SELECT
e.employeeID,
e.firstName,
e.lastName,
p.positionName,
st.statusName,
e.birthday,
e.address,
e.phoneNumber,
g.sssNumber,
g.pagibigNumber,
g.tinNumber,
s.hourlyRate,
g.philhealthNumber,
r.roleName,
e.supervisorID,
s.basicSalary,
s.grossSemiMonthlyRate,
SUM(CASE WHEN alt.allowanceTypeName = 'Rice Subsidy' THEN a.amount ELSE 0 END) AS riceSubsidy,
SUM(CASE WHEN alt.allowanceTypeName = 'Phone' THEN a.amount ELSE 0 END) AS phoneAllowance,
SUM(CASE WHEN alt.allowanceTypeName = 'Clothing' THEN a.amount ELSE 0 END) AS clothingAllowance
FROM employees e 
JOIN position p ON e.positionID = p.positionID 
JOIN status st ON e.statusID = st.statusID 
JOIN governmentNumber g ON e.employeeID = g.employeeID 
JOIN roles r ON e.roleID = r.roleID 
JOIN salary s ON e.employeeID = s.employeeID 
JOIN allowance a ON e.employeeID = a.employeeID 
JOIN allowanceType alt ON a.allowanceTypeID = alt.allowanceTypeID 
GROUP BY 
e.employeeID,
e.firstName,
e.lastName,
p.positionName,
st.statusName,
e.birthday,
e.address,
e.phoneNumber,
g.sssNumber,
g.pagibigNumber,
g.tinNumber,
s.hourlyRate,
g.philhealthNumber,
r.roleName,
e.supervisorID,
s.basicSalary,
s.grossSemiMonthlyRate 
ORDER BY e.employeeID ASC;
 
END ;;
DELIMITER ;
