CREATE DEFINER=`root`@`localhost` PROCEDURE `leavecreditGetAll`()
BEGIN
SELECT e.employeeID,
SUM(CASE WHEN lc.leaveTypeID = 1 THEN lc.balance ELSE 0 END) as vacationCredits,
SUM(CASE WHEN lc.leaveTypeID = 2 THEN lc.balance ELSE 0 END) as medicalCredits,
SUM(CASE WHEN lc.leaveTypeID = 3 THEN lc.balance ELSE 0 END) as personalCredits
FROM employees e
